// src/pages/Yachts.js
import React from 'react';
import YachtCard from '../components/YachtCard'; // Asegúrate de haber creado este componente

const Yachts = () => {
  return (
    <div className="yachts">
      <h1>Our Yachts</h1>
      <div className="yacht-cards">
        <YachtCard />
        {/* Añade más tarjetas de yates si es necesario */}
      </div>
    </div>
  );
};

export default Yachts;
